import React from 'react';
import Home from '../src/components/home/home';
import data from '../src/data/db.json'
import { Route, Routes } from '..';
import { useState } from 'react';
function App() {
  return (
    <Route>
      <Route path='/' element={<Home />} />
       <Home DATA = {data} />
    </Route>

  );
}

export default App;
